import React, { useEffect, useState } from 'react'

function DocTitle() {
    const [count, setCount] = useState(0)
    useEffect(() => {
        document.title = `count ${count}`
    }, [count])
    return (
        <div>
            <button onClick={() => { setCount(count + 1) }}>increment</button>
        </div>
    )
}

export default DocTitle
